	msgctxt: "STRINGS.BUILDINGS.PREFABS.ROBOPILOTCOMMANDMODULE.NAME",
	msgid: `<link=\\"ROBOPILOTCOMMANDMODULE\\">Robo-Pilot Capsule</link>`,
	msgstr: ``,
