	msgctxt: "STRINGS.CREATURES.SPECIES.ICEBELLY.DESC",
	msgid: `Bammoths are lumbering, nonhostile creatures that subsist on <link=\\"CARROT\\">Plume Squash</link>, <link=\\"BEANPLANTSEED\\">Nosh Beans</link> and <link=\\"FRIESCARROT\\">Squash Fries</link>.\\n\\nTheir thick overcoats can be shorn for <link=\\"BASICFABRIC\\">Reed Fiber</link>.`,
	msgstr: `
Крольмонты — это неловкие миролюбивые создания, которые питаются <link=\\"CARROT\\">перистой свёклой</link>.\\n
\\n
Их толстую шкуру можно состричь и получить <link=\\"BASICFABRIC\\">волокна камыша</link>.`,
	klei: `
Крольмонты — это неловкие миролюбивые создания, которые питаются <link=\\"CARROT\\">перьевыми тыквами</link>, <link=\\"BEAN\\">закусочными бобами</link> и <link=\\"FRIESCARROT\\">зажаренными тыквенными дольками</link>.\\n
\\n
Их густой мех можно состричь и получить <link=\\"BASICFABRIC\\">тростневиковое волокно</link>.`,
